FOR EACH ROW
  BEGIN
    INSERT INTO solr_queue_inventory (sku, triggered_at) VALUES (NEW.sku, NOW());
    INSERT INTO solr_queue_populate_sku (sku, triggered_at) VALUES (NEW.sku, NOW());

    
